import React from 'react'
import './style/Homes.css';
// import IO from '../images/home/1 (1).jpg';

class Homes extends React.Component {
    render() {
        return (
            <div className="Homes">
                <div className="Homes_container">
                    <strong><h3>Imperio Oscuro</h3></strong> 
                    <div className="Homes_ima">
                        <h3>Eros lanzó una maldición sobre la Tierra, afectando a cada ser vivo
                            después de la muerte: "Aquel que en vida haya pecado y actuado de
                            mala fe, en vez de ser perdonado recibiendo la misericordia del descanso
                            eterno, renacerá a mi imagen como un esclavo y fiel seguidor espectral, sin
                            memoria ni libertad. Su única carga será la tarea de recordar su pecado
                            olvidado para que su alma sea liberada y se le permita descansar, de lo contrario,
                            su condena será eterna". Significa que si en cualquier parte del mundo una persona
                            muere y esta durante su vida cometio un imperdonable pecado o actuo de mala fe,
                            revivirá instantáneamente dejando atrás todo recuerdo y emoción acerca de su vida y
                            de si mismo, con cambios notavles en su apariencia como que su piel se vuelve grisácea
                            o palida como la de un cadaver y aparecerían grietas en su piel como si su cuerpo se
                            rompiera, además, obtendrían capacidades y poderes sobrenaturales similares a loa de su
                            creador Eros. Parece que la unica forma de que sus almas sean liberadas y descansen en
                            paz, es que recuerden sus pecados y a quienes lastimaron, pero irónicamente, la única forma de
                            hacerlo es buscando en el dolor de otros para familiarizarse con el sufrimiento que alguna
                            vez causaron a su prójimo.
                            </h3>
                    {/* <img src={IO} width="500px" height="500px" /> */}
                    </div>
                </div>
            </div>
        )
    }
};

export default Homes;
